import axios from "axios";
const USER_BASE_REST_API_URL = "http://localhost:5002/api/auth/";

class UserApiServer {
  // Read
  getAllEmployees() {
    return axios.get(USER_BASE_REST_API_URL);
  }

  // Create; REGISTER
  registerUser(user) {

    return axios.post(`${USER_BASE_REST_API_URL}register`, user);
  }

  // LOG IN

  registerUser(user) {
    return axios.post(`${USER_BASE_REST_API_URL}login`, user);
  }
  // GET
  getEmployeeById(id) {
    return axios.get(USER_BASE_REST_API_URL + "/" + id);
  }

  // update
  updateEmployee(id, employee) {
    return axios.put(USER_BASE_REST_API_URL + "/" + id, employee);
  }

  // delete
  deleteEmployee(id) {
    return axios.delete(USER_BASE_REST_API_URL + "/" + id);
  }
}

export default new UserApiServer();
